import React from "react";
import {BrowserRouter as Router, Link} from 'react-router-dom'
import AuthContext from '../AuthContext'
class Header extends React.Component {
    constructor(props){
        super(props)
        this.logout = this.logout.bind(this)
    }
    logout(){
        this.props.context.logout()
    }
    render(){
        return (
            <ul className="nav top-nav py-3 justify-content-end">
                <li className="nav-item">
                    <Link to="/login" className="nav-link" onClick={this.logout}>Logout</Link>
                </li>
                <li className="nav-item">
                    <Link className="pt-mono nav-link" to="/core">Approve All</Link>
                </li>
            </ul>
        )
    }
}

export default (props) => (
    <AuthContext.Consumer>
        {
            (context) => <Header {...props} context={context} />
        }
    </AuthContext.Consumer>
)
